const icons = [CoffeeIcon, LightIcon, HomeIcon, LocationIcon, TemperatureIcon, TimeIcon]

export const AdvantagesSection = async () => {
  const t = await getTranslations('Pages.Home.Sections.Advantages')

  const list = t.raw('List') as AdvantagesListItem[]

  return (
    <Section>
      <H2 className='text-center'>{t('Title')}</H2>
      <ul className='mt-13 grid grid-cols-2 gap-8 md:grid-cols-3'>
        {list.map((item, index) => {
          const Icon = icons[index]

          return (
            <li
              key={item.Title}
              className='flex flex-col items-center gap-3 text-center'
            >
              <div className='relative'>
                <BlobIcon />
                <div className='absolute -top-2 left-1/2 z-10 -translate-x-1/2'>
                  <Icon />
                </div>
              </div>
              <h3 className={cn('font-extrabold md:text-lg', nunito.className)}>{item.Title}</h3>
              <p className='mx-auto max-w-73 text-sm'>{item.Text}</p>
            </li>
          )
        })}
      </ul>
    </Section>
  )
}
